  `process_name_from_for_reprocess` varchar(50) NOT NULL,
  PRIMARY KEY (`partial_test_for_trf_id`)
) ENGINE=InnoDB AUTO_INCREMENT=97 DEFAULT CHARSET=utf8mb4;

