-- ----------------------------
-- Table structure for `qc_result_for_greige_receiving_process`
-- ----------------------------
DROP TABLE IF EXISTS `qc_result_for_greige_receiving_process`;
CREATE TABLE `qc_result_for_greige_receiving_process` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pp_number` varchar(100) DEFAULT NULL,
  `version_number` varchar(100) DEFAULT NULL,
  `customer_name` varchar(100) DEFAULT NULL,
  `color` varchar(50) DEFAULT NULL,
  `style` varchar(50) DEFAULT NULL,
  `finish_width_in_inch` double DEFAULT NULL,
  `standard_for_which_process` varchar(50) DEFAULT NULL,
  `date` varchar(50) DEFAULT '',
  `before_trolley_number_or_batcher_number` varchar(50) DEFAULT '',
  `after_trolley_number_or_batcher_number` varchar(50) DEFAULT '',
  `fabric_width_in_inch` double DEFAULT NULL,
  `received_quantity_in_meter` double DEFAULT NULL,
  `short_or_excess_in_percentage` double DEFAULT NULL,
  `total_quantity_in_meter` double DEFAULT NULL,
  `total_short_or_excess_in_percentage` double DEFAULT NULL,
  `machine_name` varchar(50) DEFAULT NULL,
  `warp_yarn_count_value` varchar(10) DEFAULT '',
  `weft_yarn_count_value` varchar(10) DEFAULT '',
  `no_of_threads_in_warp_value` varchar(10) DEFAULT '',
  `no_of_threads_in_weft_value` varchar(10) DEFAULT '',
  `mass_per_unit_per_area_value` varchar(10) DEFAULT '',
  `gerige_width_value` varchar(10) DEFAULT '',
  `polyester_fiber_content_value` varchar(10) DEFAULT '',
  `cotton_fiber_content_value` varchar(10) DEFAULT '',
  `other_fiber_content_value` varchar(10) DEFAULT NULL,
  `status` varchar(10) DEFAULT NULL,
  `remarks` varchar(250) DEFAULT NULL,
  `recording_person_id` varchar(30) DEFAULT NULL,
  `recording_person_name` varchar(50) DEFAULT NULL,
  `recording_time` datetime DEFAULT NULL,
  `version_id` varchar(20) NOT NULL,
  `customer_id` varchar(20) NOT NULL,
  `report_serial_no` varchar(20) NOT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

